/* eslint-env node */
// @ts-check

/** @type {import("eslint").Linter.Config} */
const config = {
  parser: "@typescript-eslint/parser",
  ignorePatterns: ["**/*.css.d.ts", "dist", "build"],
  plugins: ["react", "@typescript-eslint", "jest"],
  extends: [
    "plugin:jest/recommended",
    "eslint:recommended",
    "plugin:react/recommended",
    "plugin:@typescript-eslint/recommended",
    "plugin:react-hooks/recommended",
    "prettier",
    "plugin:prettier/recommended"
  ],
  settings: {
    react: {
      version: "detect" // React version. "detect" automatically picks the version you have installed.
    }
  },
  rules: {
    "react/jsx-uses-react": "off",
    "react/prop-types": "off",
    "prettier/prettier": "warn",
    "no-console": "warn",
    "@typescript-eslint/no-unused-vars": "off",
    "@typescript-eslint/no-empty-interface": "off",
    "@typescript-eslint/no-explicit-any": "warn"
  },
  overrides: [
    {
      files: ["**/?(*.)+(spec|test).[jt]s?(x)"],
      env: {
        jest: true
      },
      extends: ["plugin:jest/recommended", "plugin:testing-library/react"],
      rules: {
        "testing-library/no-render-in-setup": "off",
        "testing-library/no-node-access": "off",
        "testing-library/render-result-naming-convention": "off",
        "testing-library/no-render-in-lifecycle": "off"
      }
    }
  ]
};

module.exports = config;

/* eslint-disable @typescript-eslint/no-require-imports */
/* eslint-disable no-undef */
const jalali = require("./dist/cjs/jalali.js");
module.exports = jalali;

import type { Config } from "@jest/types";

const sharedConfig: Config.InitialOptions = {
  testEnvironment: "jsdom",
  setupFilesAfterEnv: ["<rootDir>/test/setup.ts"],
  fakeTimers: { enableGlobally: true },
  transform: {
    "^.+\\.tsx?$": [
      "@swc/jest",
      { jsc: { transform: { react: { runtime: "automatic" } } } }
    ],
    "^.+\\.css$": "jest-transform-css"
  }
};

const config: Config.InitialOptions = {
  coverageReporters: ["lcov", "text", "clover"],
  projects: [
    {
      ...sharedConfig,
      displayName: "src",
      roots: ["<rootDir>/src"],
      moduleNameMapper: {
        "@/test/(.*)": ["<rootDir>/test/$1"],
        "^(\\.\\.?\\/.+)\\.jsx?$": "$1" // see https://github.com/kulshekhar/ts-jest/issues/1057
      }
    },
    {
      ...sharedConfig,
      displayName: "examples",
      roots: ["<rootDir>/examples"],
      moduleNameMapper: {
        "@/test/(.*)": ["<rootDir>/test/$1"],
        "react-day-picker/persian": ["<rootDir>/src/persian.tsx"],
        "react-day-picker": ["<rootDir>/src/index.ts"],
        "^(\\.\\.?\\/.+)\\.jsx?$": "$1" // see https://github.com/kulshekhar/ts-jest/issues/1057
      }
    },
    {
      ...sharedConfig,
      displayName: "examples/built",
      roots: ["<rootDir>/examples"],
      moduleNameMapper: {
        "@/test/(.*)": ["<rootDir>/test/$1"],
        "react-day-picker/persian": ["<rootDir>/dist/cjs/persian.js"],
        "react-day-picker": ["<rootDir>/dist/cjs/index.js"],
        "../src": ["<rootDir>/dist/cjs"], // allow using same @/test/elements in both env
        "^(\\.\\.?\\/.+)\\.jsx?$": "$1" // see https://github.com/kulshekhar/ts-jest/issues/1057
      }
    }
  ]
};

export default config;

/* eslint-disable @typescript-eslint/no-require-imports */
/* eslint-disable no-undef */
const locale = require("./dist/cjs/locale.js");
module.exports = locale;

{
  "name": "react-day-picker",
  "version": "9.5.0",
  "description": "Customizable Date Picker for React",
  "author": "Giampaolo Bellavite <io@gpbl.dev>",
  "homepage": "https://daypicker.dev",
  "packageManager": "pnpm@9.11.0",
  "engines": {
    "node": ">=18"
  },
  "license": "MIT",
  "repository": {
    "type": "git",
    "url": "https://github.com/gpbl/react-day-picker"
  },
  "bugs": {
    "url": "https://github.com/gpbl/react-day-picker/issues"
  },
  "main": "./dist/cjs/index.js",
  "types": "./dist/cjs/index.d.ts",
  "module": "./dist/esm/index.js",
  "style": "./src/style.css",
  "type": "module",
  "exports": {
    ".": {
      "import": {
        "types": "./dist/esm/index.d.ts",
        "default": "./dist/esm/index.js"
      },
      "require": {
        "types": "./dist/cjs/index.d.ts",
        "default": "./dist/cjs/index.js"
      }
    },
    "./jalali": {
      "import": {
        "types": "./dist/esm/jalali.d.ts",
        "default": "./dist/esm/jalali.js"
      },
      "require": {
        "types": "./dist/cjs/jalali.d.ts",
        "default": "./dist/cjs/jalali.js"
      }
    },
    "./persian": {
      "import": {
        "types": "./dist/esm/persian.d.ts",
        "default": "./dist/esm/persian.js"
      },
      "require": {
        "types": "./dist/cjs/persian.d.ts",
        "default": "./dist/cjs/persian.js"
      }
    },
    "./locale": {
      "import": {
        "types": "./dist/esm/locale.d.ts",
        "default": "./dist/esm/locale.js"
      },
      "require": {
        "types": "./dist/cjs/locale.d.ts",
        "default": "./dist/cjs/locale.js"
      }
    },
    "./style": {
      "sass": "./src/style.css"
    },
    "./style.css": {
      "style": {
        "default": "./src/style.css"
      },
      "import": {
        "types": "./src/style.module.css.d.ts",
        "default": "./src/style.css"
      },
      "require": {
        "types": "./src/style.module.css.d.ts",
        "default": "./src/style.css"
      }
    },
    "./style.module": {
      "sass": "./src/style.module.css"
    },
    "./style.module.css": {
      "style": {
        "default": "./src/style.module.css"
      },
      "import": {
        "types": "./src/style.module.css.d.ts",
        "default": "./src/style.module.css"
      },
      "require": {
        "types": "./src/style.module.css.d.ts",
        "default": "./src/style.module.css"
      }
    },
    "./src/style.css": {
      "style": {
        "default": "./src/style.css"
      },
      "import": {
        "types": "./src/style.module.css.d.ts",
        "default": "./src/style.css"
      },
      "require": {
        "types": "./src/style.module.css.d.ts",
        "default": "./src/style.css"
      }
    },
    "./src/style.module.css": {
      "style": {
        "default": "./src/style.module.css"
      },
      "import": {
        "types": "./src/style.module.css.d.ts",
        "default": "./src/style.module.css"
      },
      "require": {
        "types": "./src/style.module.css.d.ts",
        "default": "./src/style.module.css"
      }
    },
    "./dist/style.css": {
      "style": {
        "default": "./src/style.css"
      },
      "import": {
        "types": "./src/style.module.css.d.ts",
        "default": "./src/style.css"
      },
      "require": {
        "types": "./src/style.module.css.d.ts",
        "default": "./src/style.css"
      }
    },
    "./dist/style.module.css": {
      "style": {
        "default": "./src/style.module.css"
      },
      "import": {
        "types": "./src/style.module.css.d.ts",
        "default": "./src/style.module.css"
      },
      "require": {
        "types": "./src/style.module.css.d.ts",
        "default": "./src/style.module.css"
      }
    },
    "./package.json": {
      "import": "./package.json",
      "require": "./package.json",
      "default": "./package.json"
    },
    "./examples": {
      "types": "./examples/index.d.ts",
      "import": "./examples/index.ts"
    }
  },
  "scripts": {
    "prepublish": "pnpm build",
    "build": "pnpm build:cjs && pnpm build:esm && pnpm build:css",
    "build:cjs": "tsc --project tsconfig-cjs.json && echo '{ \"type\": \"commonjs\" }' > dist/cjs/package.json",
    "build:esm": "tsc --project tsconfig-esm.json",
    "build:css": "./scripts/build-css.sh ./src/style.css ./src/style.module.css",
    "lint": "eslint .",
    "test": "jest --selectProjects examples --selectProjects src",
    "test:build": "jest --selectProjects examples/built",
    "test-watch": "jest --watch",
    "typecheck": "tsc --project ./tsconfig.json --noEmit",
    "typecheck-watch": "tsc --project ./tsconfig.json --noEmit --watch"
  },
  "files": [
    "dist",
    "src",
    "examples",
    "website/docs",
    "tsconfig.json",
    "tsconfig-base.json",
    "style.css",
    "style.module.css",
    "jalali.js",
    "jalali.d.ts",
    "locale.js",
    "locale.d.ts"
  ],
  "dependencies": {
    "@date-fns/tz": "^1.2.0",
    "date-fns": "^4.1.0",
    "date-fns-jalali": "^4.1.0-0"
  },
  "devDependencies": {
    "@jest/types": "^29.6.3",
    "@swc/core": "^1.10.1",
    "@swc/jest": "^0.2.37",
    "@testing-library/dom": "^10.4.0",
    "@testing-library/jest-dom": "^6.6.3",
    "@testing-library/react": "^16.1.0",
    "@testing-library/user-event": "^14.5.2",
    "@trivago/prettier-plugin-sort-imports": "^5.2.0",
    "@types/jest": "^29.5.14",
    "@types/node": "^22.10.2",
    "@types/react": "^19.0.2",
    "@types/react-dom": "^19.0.2",
    "@typescript-eslint/eslint-plugin": "^8.18.2",
    "@typescript-eslint/parser": "^8.18.2",
    "eslint": "^8.57.1",
    "eslint-config-prettier": "^9.1.0",
    "eslint-import-resolver-typescript": "^3.7.0",
    "eslint-plugin-import": "^2.31.0",
    "eslint-plugin-jest": "^28.10.0",
    "eslint-plugin-prettier": "^5.2.1",
    "eslint-plugin-react": "^7.37.3",
    "eslint-plugin-react-hooks": "^5.1.0",
    "eslint-plugin-require-extensions": "^0.1.3",
    "eslint-plugin-testing-library": "^6.5.0",
    "html-validate": "^8.29.0",
    "jest": "^29.7.0",
    "jest-environment-jsdom": "^29.7.0",
    "jest-transform-css": "^6.0.1",
    "mockdate": "^3.0.5",
    "prettier": "^3.4.2",
    "prettier-plugin-jsdoc": "^1.3.0",
    "react": "^19.0.0",
    "react-dom": "^19.0.0",
    "ts-node": "^10.9.2",
    "tslib": "^2.8.1",
    "typescript": "~5.7.2",
    "typescript-css-modules": "^1.0.4"
  },
  "peerDependencies": {
    "react": ">=16.8.0"
  },
  "funding": {
    "type": "individual",
    "url": "https://github.com/sponsors/gpbl"
  }
}

