  "extends": "./tsconfig-base.json",
  "compilerOptions": {
    "outDir": "./dist/cjs",
    "module": "CommonJS"
  },
  "include": ["src"],
  "exclude": ["**/*.test.*"]
}

{
  "extends": "./tsconfig-base.json",
  "compilerOptions": {
    "paths": {
      "@/test/*": ["./test/*"]
    },
    "noEmit": true,
    "types": ["node", "jest", "@testing-library/jest-dom"],
    "lib": ["dom", "dom.iterable", "esnext"]
  },
  "include": ["src"],
  "exclude": ["website", "**/*.test.*"]
}

{
  "extends": "./tsconfig-base.json",
  "compilerOptions": {
    "outDir": "./dist/esm",
    "module": "ES2020"
  },
  "include": ["src"],
  "exclude": ["**/*.test.*"]
}

{
  "extends": "./tsconfig-base.json",
  "compilerOptions": {
    "paths": {
      "@/test": ["./test"],
      "@/test/*": ["./test/*"],
      "react-day-picker": ["./src"],
      "react-day-picker/*": ["./src/*"]
    },
    "noEmit": true,
    "types": ["node", "jest", "@testing-library/jest-dom", "@types/jest"]
  },
  "include": ["src", "test", "**/*.test.*", "examples"],
  "exclude": ["website"]
}
